import React from 'react';

const Pagination = ({ personPerTab, numOfPeople }) => {
  const pageNumbers = [];
  for (let i = 1;i <= Math.ceil(numOfPeople / personPerTab);i += 1) {
    pageNumbers.push(i);
  }
  return (
    <nav>
      <ul className="pagination">
        { pageNumbers.map((number) => (
          <li key={ number }>
            <a href="!#">{ number }</a>
          </li>
        )) }
      </ul>
    </nav>
  );
};

export default Pagination;
